 #include<stdio.h>

 int main(){
        // Operadores relacionais
        // ==, !=, >, <, >=, <=
        // Retorna 1 se verdadeiro e 0 se falso
    
        int a = 10;
        int b = 20;
    
        printf("a == b: %d\n", a == b); // 0
        printf("a != b: %d\n", a != b); // 1
        printf("a > b: %d\n", a > b);   // 0
        printf("a < b: %d\n", a < b);   // 1
        printf("a >= b: %d\n", a >= b); // 0
        printf("a <= b: %d\n", a <= b); // 1
    
        return 0;


 }